  false,\n\t\"url\": null,\n\t\"notes\": \"Catch shares are one method of catch allocation
  utilized by fisheries managers in the United States West Coast groundfish fishery.
  Catch share management results in social impacts to affected fishing communities.
  It is important to document and understand these social impacts in order to account
  for their effects during fishery management decision-making.nnThis project is a
  multi-year project and ongoing for the foreseeable future.  The federal PI works
  with varying levels of NOAA affiliates to collect, analyze, and report upon the
  data.  Reports will be generated to include comparisons between data collected over
  time and stand alone data.  Reports will be provided to management entities to include
  the Pacific Fisheries Management Council.nnPrimary Quantitive/Qualitative Dataset.\",\n\t\"owner_org\":
